<?php

namespace Database\Factories;

use Illuminate\Database\Eloquent\Factories\Factory;

/**
 * @extends \Illuminate\Database\Eloquent\Factories\Factory<\App\Models\Trip>
 */
class TripFactory extends Factory
{
    /**
     * Define the model's default state.
     *
     * @return array<string, mixed>
     */
    public function definition()
    {
        $startDate = $this->faker->dateTimeBetween('now', '+2 years');
        $endDate = $this->faker->dateTimeBetween($startDate, '+2 years');

        $minTavelers = $this->faker->numberBetween(1,5);
        $maxTavelers = $minTavelers + $this->faker->numberBetween(1,5);

        $seederImages = [
            'data:image/jpeg;base64,',
            'data:image/jpeg;base64,',
            'data:image/jpeg;base64,',
            'data:image/jpeg;base64,',
            'data:image/jpeg;base64,',
            'data:image/jpeg;base64,',
            'data:image/jpeg;base64,',
            'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQdPqivnAgse1QYKUQMEjtvYfjzShIY5QOZcQ&usqp=CAU',
            'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT18wdudAtw94DjAJeciOin0b_4W7aqtbcyXA&usqp=CAU',
            'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTIik_inU5HEozFp2-bne0rr8n1klWPv5RQ9g&usqp=CAU',
            'data:image/jpeg;base64,',
            'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSh6I4_-8PRYKMMGhqtYmHtfPXYqSwCbhiHuA&usqp=CAU',
            'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQh3jfAJxMZy6B1L7rvJBhKogSsGm71c7QcjA&usqp=CAU'
        ];


        return [
            'destination' => $this->faker->city,
            'startDate' => $startDate,
            'endDate' => $endDate,
            'timespan' => $this->faker->boolean,
            'description' => $this->faker->paragraph,
            'vehicle' => $this->faker->randomElement(['car', 'plane', 'train', 'motorbike']),
            'image_link' => $this->faker->randomElement($seederImages),
            'trip_link' => $this->faker->url(),
            'name' => $this->faker->city,
            'min_travelers' => $minTavelers,
            'max_travelers' => $maxTavelers

        ];
    }
}
